import { connect } from 'react-redux'

export default class Fetch extends Component {
    constructor(props) {
        super(props);
        this.state = {
            students: []
        }
    }

    componentDidMount() {fetch("https://bayut.p.rapidapi.com/properties/list?locationExternalIDs=5002%2C6020&purpose=for-rent&hitsPerPage=25&page=0&lang=en&sort=city-level-score&rentFrequency=monthly&categoryExternalID=4", {
      "method": "GET",
      "headers": {
        "x-rapidapi-host": "bayut.p.rapidapi.com",
        "x-rapidapi-key": "14d4a5de90msh2e22cfdc0011ca4p15bd3cjsnd1d07560555a"
      }
    })
    .then(response => {
      console.log(response);
    })
    .catch(err => {
      console.error(err);
    });

  }

    render() {
    return (
        <>
            <h1 className="text-center mt-5 text-success fw-bolder"></h1>
            <table className="table table-dark table-hover mt-5 text-center w-75 mx-auto">
                <thead>
                    <tr>
                    <th scope="col">id</th>
                    <th scope="col">First</th>
                    <th scope="col">Last</th>
                    </tr>
                </thead>
                <tbody>
                    {this.state.students.map((s, i) => <StudentList student={s} key={i}/>)}
                </tbody>
            </table>
        </>
    );
  }
}
